  private final String displayName;

  private final ItemRarity rarity;

  private final String id;

  private final String shardId;

  private final ShardCategory category;

  private final ShardFamily[] families;

  private final String abilityName;

  private final Lore lore;

  private final String headValue;

  Shard(String id, String displayName, ItemRarity rarity, ShardCategory category,
      ShardFamily[] families, String shardId, String abilityName, String[] loreRows,
      String headValue, Map<String, Function<Integer, Double>> placeholder) {
    this.id = id;
    this.displayName = displayName;
    this.rarity = rarity;
    this.category = category;
    this.families = families;
    this.shardId = shardId;
    this.abilityName = abilityName;
    this.lore = new Lore(List.of(loreRows), AttributeMenu.toPlaceholderMap(this, placeholder));
    this.headValue = headValue;
  }

  @Override
  public String getDisplayName() {
    return this.displayName;
  }

  @Override
  public ItemRarity getRarity() {
    return this.rarity;
  }

  @Override
  public String getShardId() {
    return this.shardId;
  }

  @Override
  public String getAbilityName() {
    return this.abilityName;
  }

  @Override
  public String getId() {
    return this.id;
  }

  @Override
  public ShardCategory getCategory() {
    return this.category;
  }

  @Override
  public ShardFamily[] getFamilies() {
    return this.families;
  }

  @Override
  public Lore getLore() {
    return this.lore;
  }

  @Override
  public String getHeadValue() {
    return this.headValue;
  }

  @Override
  public Material getMaterial() {
    return Material.PLAYER_HEAD;
  }
